import Index from './components';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Index selected="who-we-are"  />} />
        <Route path="/who-we-are" element={<Index selected={this.path}/>} />
      </Routes>
      <Navbar />
    </Router>
  );
}

export default App;
